import React from 'react';
import emailIcon from './pic/email_icon.png';
import passwordIcon from './pic/password_icon.png';

class Login extends React.Component {
    render(){
        return(
            <form className = "LoginForm" >

                <h1>Sign in</h1>
                <h3>to comtinuous your service</h3>

                <div className="Form">
                    <img src={emailIcon} width="50" />
                    <input type="email" placeholder="Email" />
                </div>

                <div className="Form">
                    <img src={passwordIcon} width="50" />
                    <input type="password" placeholder="Password" />
                </div>

                <button className="Button" type="submit">Sing in</button>

                <h3>Not a member ?</h3>
                <button className="Button" type="submit">Sing up</button>
            </form>
            
        );
    }
}
export default Login;
